    data: |
      SELECT col2 * + col0 FROM tab2 (FORMAT parquet) WHERE NOT ( + col0 ) NOT BETWEEN col2 AND + col1 * - col1 + - col1 * 89 * - + col2;
  - name: tab2

outputs:
  - name: q6643.out
    data: |
      1058
      2560
      4350
